import React from "react";

export default class MundialQatarPagina extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            Mundial: []
        }
this.componentDidMount() 
        fetch("https://raw.githubusercontent.com/openfootball/football.json/master/2020-21/en.1.json")
        .then(response => response.json())
        .then(data => {
            this.setState({
                Mundial: data
            })
        }
        )
    }   

    render() {
        return(
            <p>Pagina de Mundial Qatar</p>          
        )
    }
}
